    gifts = [0] * n

    def dfs(friend: int, visit: set) -> bool:
        if friend in visit:
            return False
        visit.add(friend)
        if friends[friend] != 0:
            if dfs(friends[friend] - 1, visit):
                return True
        else:
            for i in unknown:
                if i not in visit:
                    friends[friend] = i + 1
                    if dfs(i, visit.copy()):
                        return True
                    friends[friend] = 0
        visit.remove(friend)
        return False

    for i in range(n):
        if dfs(i, set()):
            break

    for i in range(n):
        gifts[i] = friends[i] if friends[i] != 0 else i + 1

    return ' '.join(map(str, gifts))

