        stack = []
        for char in bracket_seq:
            if char == '(':
                stack.append(char)
            else:
                if not stack:
                    return False
                stack.pop()
        return not stack

    def insert_characters(bracket_seq: str, s: str) -> str:
        for i in range(len(bracket_seq) - len(s) + 1):
            if bracket_seq[i:i + len(s)] == s:
                return bracket_seq[:i] + '1+' * (len(s) - 1) + bracket_seq[i:]
        return None

    count = 0
