    n_str = str(n)

    def is_divisible_by_25(num_str: str) -> bool:
        num = int(num_str)
        return num % 25 == 0

    def swap(num_str: str, i: int, j: int) -> str:
        chars = list(num_str)
        chars[i], chars[j] = chars[j], chars[i]
        return ''.join(chars)

    def min_moves(num_str: str) -> int:
        if is_divisible_by_25(num_str):
            return 0

        for i in range(len(num_str) - 1):
            if num_str[i] == '0' and (i == 0 or num_str[i - 1] == '0'):
                continue
            for j in range(i + 1, len(num_str)):
                if num_str[j] == '0' and (j == len(num_str) - 1 or num_str[j + 1] == '0'):
                    continue

                new_num_str = swap(num_str, i, j)
                if is_divisible_by_25(new_num_str):
                    return 1 + min_moves(new_num_str)

        return -1

    return str(min_moves(n_str))

