    a = list(map(int, stdin.split()[2:]))
    special_offers = []

    for i in range(m):
        special_offers.append(list(map(int, stdin.split()[2:]))[i * 3:i * 3 + 3])

    parent = [i for i in range(n)]
    rank = [0] * n
    costs = [0] * (n * n)

    for i in range(m):
        x, y, w = special_offers[i]
        union(parent, rank, x - 1, y - 1)
        costs[x * n + y] = w

    for i in range(n):
        for j in range(i + 1, n):
            if find(parent, i) != find(parent, j):
                union(parent, rank, i, j)

    min_cost = 0
    for i in range(n):
