        for num in nums:
            result = lcm(result, num)
        return result

    def factorize(n: int, lcm: int) -> List[int]:
        factors = []
        for i in range(1, int(n**0.5) + 1):
            if n % i == 0:
                factors.append(i)
                if i != n // i:
                    factors.append(n // i)
        return sorted(factors)

    def count_ways(nums: List[int], lcm: int, target: int) -> int:
        count = 0
        for factor in factorize(lcm, lcm):
            count += sum(nums[i] // factor * count_ways(nums, lcm // factor, target)
                     for i in range(len(nums)))
        if lcm == target:
            count += 1
        return count

