                    min_dist = distances[i]
                    next_node = i

            if next_node == -1:
                break

            visited[next_node] = True

            for neighbor, weight in graph[next_node]:
                if not visited[neighbor] and distances[neighbor] > min_dist + weight:
                    distances[neighbor] = min_dist + weight

        return distances

    # Calculate distances to all nodes from each node
    distances = [dijkstra(i) for i in range(n)]

