    t, N, M = map(int, stdin.splitlines()[0].split())
    wall_mara = stdin.splitlines()[1:]

    def is_safe(x, y):
        return 0 <= x < N and 0 <= y < M and wall_mara[x][y] != '1'

    def dfs(x, y, visited):
        if (x, y) in visited:
            return 0
        visited.add((x, y))
        if wall_mara[x][y] in 'UDLR':
            directions = {'U': (x-1, y), 'D': (x+1, y), 'L': (x, y-1), 'R': (x, y+1)}
            for d, (new_x, new_y) in directions.items():
                if is_safe(new_x, new_y) and d != wall_mara[x][y]:
                    return dfs(new_x, new_y, visited) + 1
            return 0
        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            new_x, new_y = x + dx, y + dy
            if is_safe(new_x, new_y):
                return dfs(new_x, new_y, visited) + 1
        return 0

    visited = set()
    start_x, start_y = 0, 0
    for x in range(N):
        for y in range(M):
            if wall_mara[x][y] == 'S':
                start_x, start_y = x, y
                break
        else:
            continue
        break

    escape_time = dfs(start_x, start_y, visited)

    if escape_time <= t:
        return str(escape_time)
    else:
        return "NOT POSSIBLE"

