            row1, col1 = divmod(table.index(char1), 5), table[table.index(char1)].index(char1)
            row2, col2 = divmod(table.index(char2), 5), table[table.index(char2)].index(char2)
            if char1 == char2:
                result += char1 + "X"
                continue
            if row1 == row2:
                result += table[row1][(col1 + 1) % 5] + table[row2][(col2 + 1) % 5]
            elif col1 == col2:
                result += table[(row1 + 1) % 5][col1] + table[(row2 + 1) % 5][col2]
            else:
                result += table[row1][col2] + table[row2][col1]
        return result

    # Encrypt the plaintext
    encrypted_text = encrypt(plaintext)

    return encrypted_text.upper()

