    def dfs(start_x: int, start_y: int, remaining_charge: int, visited: set) -> bool:
        if (start_x, start_y) == (end_x, end_y):
            return remaining_charge == 0
        elif remaining_charge < 0:
            return False
        elif (start_x, start_y) in visited:
            return False

        visited.add((start_x, start_y))

        # Move North
        if dfs(start_x, start_y + 1, remaining_charge - 1, visited):
            return True

        # Move East
        if dfs(start_x + 1, start_y, remaining_charge - 1, visited):
            return True

        # Move South
        if dfs(start_x, start_y - 1, remaining_charge - 1, visited):
            return True

        # Move West
        if dfs(start_x - 1, start_y, remaining_charge - 1, visited):
            return True

        # U-turn
        if dfs(start_x, start_y, remaining_charge, visited):
            return True

        visited.remove((start_x, start_y))
        return False

    return "Y" if dfs(start_x, start_y, initial_charge, set()) else "N"

